import React from 'react'
import { Image, StyleSheet, View, Text } from 'react-native'

const Configuration = () => {
    const estadistica = "https://previews.123rf.com/images/jevee/jevee1606/jevee160600877/59172742-resumen-elaborado-por-fondo-colorido-fondo-de-pantalla-art%C3%ADstica-en-colores-verde-rosa-con-puntos.jpg";
    return (
        <View style={styles.container}>
            <View>
                <Text>ESTADISTICAS</Text>
                <Image source={{ uri: estadistica }} style={styles.estad} />
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: 'white'
    },
    estad: {
        width: "25%",
        height: 100, // Ajusta la altura deseada para la imagen
        resizeMode: 'contain', // Ajusta el modo de redimensionamiento de la imagen
    },
})

export default Configuration;
